import React, { useState } from 'react';
import Navbar from '../../components/navbar/Navbar'
import Header from '../../components/header/header'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faCircleXmark ,faCircleArrowLeft, faCircleArrowRight, faLocationDot} from "@fortawesome/free-solid-svg-icons"
import MailList from '../../components/mailList/MailList'
import Footer from '../../components/footer/Footer'
import './hotel.css'
const Hotel = () => {

    const [slideNumber, setSlidNumber] = useState(0);
    const [open, setOpen] = useState(false);

    const photos = [{
        src:"data:image/jpeg;base64,"
    },
{
    src:"data:image/jpeg;base64,"
},
{
    src:"data:image/jpeg;base64,"
},
{
    src:"data:image/jpeg;base64,"
},
{
    src: "data:image/jpeg;base64,"
},
{
    src:"data:image/jpeg;base64,"
},]

    const handleOpen = (i) => {
        setSlidNumber(i);
        setOpen(true);
    }
    
    const handleMove = (direction) => {
        let newSlidNumber;

        if(direction == "l"){
            newSlidNumber = slideNumber === 0 ? 5 : slideNumber - 1;
        }else{
            newSlidNumber = slideNumber === 5 ? 0 : slideNumber + 1;
        }
        // setSlideNumber(newSlidNumber)
        setSlidNumber(newSlidNumber)
    }


    return(<div><Navbar/>
    <Header type="list"/>
    
    <div className="hotelContainer">
        { open && <div className="slider">
            
            <FontAwesomeIcon icon={faCircleXmark} className="close"  onClick={()=>setOpen(false)}/>
            <FontAwesomeIcon icon={faCircleArrowLeft} className="arrow" onClick={()=>handleMove("l")}/>
            <div className="sliderWrapper">
                <img src={photos[slideNumber].src} alt="" className="sliderImg" onClick={()=>handleMove("r")}/>
            </div>
            <FontAwesomeIcon icon={faCircleArrowRight} className="arrow"/>

        </div>}
        <div className="hotelWrapper">
            <button className="bookNow">Reserve or Book Now</button>
            <h1 className="hotelTitle">Grand Hotel</h1>
            <div className="hotelAddress">
                <FontAwesomeIcon icon={faLocationDot}/>
                <span>Elton St 125 New york</span>
            </div>
            <span className="hotelDistance">Excellent location - 500m from center</span>
            <span className="hotelPriceHighlight">
                Book a stay ever over $114 at this property and get a free airport taxi
            </span>
            <div className="hotelImges">
                {photos.map(photos=>(
                    <div className="hotelImgWrapper">
                        <img 
                         src={photos.src} alt="" className="hotelImg" />
                        {/* <img onClick={()=>handleOpen(i)} src={photos.src} alt="" className="hotelImg" /> */}
                    </div>
                ))}
            </div>
            <div className="hotelDetails">
                <div className="hotelDetailsTexts">
                <h1>Stay in the heart of krakow </h1>
                <p className="hotelDesc">
                Located a 5-minute walk from St.

Florian's Gate in Krakow, Tower

Street Apartments has

accommodations with air

conditioning and

free WiFi. The units come with

hardwood floors and feature a

fully equipped kitchenette with a

microwave, a flat-screen TV,

and a private bathroom with shower

and a hairdryer. A fridge is

also offered, as well as an

electric tea pot and a coffee

machine. Popular points of interest

near the apartment include

Cloth Hall, Main Market Square and

Town Hall Tower. The nearest

airport is John Paul II

International Kraków Balice, 16.1 km

from Tower Street Apartments, and airport shuttle service.
                </p>
                </div>
                
                <div className="hotelDetailsPrice"> 
                <h1>Perfect for a 9-night stay!</h1>
                <span>
                    Located in the real heart of krakow, this property has an 
                    excellent location score of 9.8!
                </span>
                <h2> <b>$945</b> (9 nights)</h2>
                <button>Reserve or Book Now!</button>
                </div>

                </div>
        </div>
        
    </div>
    <MailList/>
    <Footer/>
    </div>);
}

export default Hotel;